import Card from '../card/Card';
import style from './cards.module.css'
export default function Cards({characters}) {
   return (<div className={style.cards}>{
      characters.map(({id,name,species,gender,image,origin,status})=>{
            return (
               <Card
               key={id} 
               name={name} 
               species={species} 
               gender={gender} 
               image={image} 
               origin={origin.name} 
               status={status}
               />
            )
         }
      )
      }</div>);
}
